INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `dateSortie`, `prix`, `synopsys`, `image`, `quantity`, `id_commandebooks`) VALUES
(2, 'Le Sang des elfes', 'Broché', 'Andrzej Sapkowski', '2017-10-31', '20 €', 'Du beau royaume de Cintra, il ne reste plus que des ruines. L\'empire de Nilfgaard a tout massacré et la reine Calanthe s\'est jetée du haut des créneaux. Seule survivante, la petite princesse Ciri a réussi à fuir la capitale. Mais des espions sont aussitôt envoyés à ses trousses. L\'enfant semble avoir un rôle crucial dans la destinée de ce monde... Geralt de Riv, le chasseur de monstres, l\'a bien compris en recueillant la fillette. Conduite à Kaer Morhen, l\'antre des sorceleurs, elle y est initiée aux arts magiques. Aidé par la magicienne Merigold, Geralt découvrira la véritable nature de l\'enfant et l\'ampleur de ses pouvoirs qui suscitent la convoitise : un mystérieux sorcier est à sa recherche et n\'hésitera pas à menacer les amis du sorceleur pour arriver à ses fins...', , 1, 1);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `dateSortie`, `prix`, `synopsys`, `image`, `quantity`, `id_commandebooks`) VALUES
(3, 'Le Silmarillion', 'Broché ', 'J. R. R. Tolkien', '2003-11-20', '6 € 95', 'Les Premiers Jours du Monde étaient à peine passés quand Fëanor, le plus doué des Elfes, créa les trois Silmarils. Ces bijoux renfermaient la Lumière des Deux Arbres de Valinor. Morgoth, le premier Prince de la Nuit, était encore sur la Terre du Milieu, et il fut fâché d\'apprendre que la Lumière allait se perpétuer. Alors il enleva les Silmarils, les fit sertir dans son diadème et garder dans la forteresse d\'Angband. Les Elfes prirent les armes pour reprendre les joyaux et ce fut la première de toutes les guerres. Longtemps, longtemps après, lors de la Guerre de l\'Anneau, Elrond et Galadriel en parlaient encore.', , 5000, 3);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `dateSortie`, `prix`, `synopsys`, `image`, `quantity`, `id_commandebooks`) VALUES
(4, 'L\'héritage', 'Broché ', 'Christopher Paolini', '2010-04-04', '3 € 62', 'Eragon n\'a que quinze ans, mais le destin de l\'Empire eEragon n\'a que quinze ans, mais le destin de l\'Empire est désormais entre ses mains !C\'est en poursuivant une biche dans la montagne que le jeune Eragon, quinze ans, tombe sur une magnifique pierre bleue, qui s\'avère être... un oeuf de dragon ! Fasciné, il l\'emporte à Carvahall, le village où il vit pauvrement avec son oncle et son cousin. Il n\'imagine pas alors qu\'une dragonne, porteuse d\'un héritage ancestral, va en éclore...Très vite, la vie d\'Eragon est bouleversée. Contraint de quitter les siens, le jeune homme s\'engage dans une quête qui le mènera aux confins de l\'empire de l\'Alagaësia. Armé de son épée et guidé par les conseils de Brom, le vieux conteur, Eragon va devoir affronter avec sa dragonne les terribles ennemis envoyés par le roi Galbatorix, dont la malveillance démoniaque ne connaît aucune limite.', , 0, NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `dateSortie`, `prix`, `synopsys`, `image`, `quantity`, `id_commandebooks`) VALUES
(5, 'One Piece - Tome 1 : A l\'aube d\'une grande aventure', 'Mangas', 'Eiichiro Oda', '2000-09-01', '3€80', 'Nous sommes à l\'ère des pirates. Lufy, un garçon espiègle, rêve de devenir le roi des pirates en trouvant le \" One Piece \", un fabuleux trésor. Par mégarde, Lufy a avalé un jour un fruit démoniaque qui l\'a transformé en homme caoutchouc. Depuis, il est capable de contorsionner son corps élastique dans tous les sens, mais il a perdu la faculté de nager.\r\nAvec l\'aide de ses précieux amis, dont le fidèle Shanks, il va devoir affronter de redoutables pirates dans des aventures toujours plus rocambolesques.', , 15, NULL);
INSERT INTO `books` (`id_book`, `titre`, `collection`, `auteur`, `dateSortie`, `prix`, `synopsys`, `image`, `quantity`, `id_commandebooks`) VALUES
(6, 'Naruto: tome 1', 'Shonen Kana', 'Masashi Kishimoto', '2002-03-15', '3€', 'Il est têtu, ce petit Naruto. Farceur et plein d\'imagination, mais surtout très têtu. Il n\'a qu\'une idée en tête : devenir le meilleur ninja de son village et recevoir le titre suprême de Maître Hokage. Seulement, pour ça, il faudrait qu\'il soit reçu à l\'examen. Et franchement, ce n\'est pas gagné ! Ce manga se situe dans la lignée de séries d\'aventures comme Dragon Ball ou Hunter X Hunter. Il y a de l\'action, beaucoup d\'humour, une vraie fantaisie. C\'est aussi une bonne introduction à l\'art martial du Ninjutsu, à ses rites et à ses traditions. Et Naruto est un personnage diablement attachant, plein d\'entrain malgré ses fêlures intérieures...', , 2000, NULL);

